package com.carlosli.leetcode.hashtable;

import java.util.Arrays;
import java.util.HashMap;

/**
 * Created by yulongli on 2017/1/19.
 */
public class ValidAnagram242 {
    /*
    统计每个字母出现的次数，然后进行对比
     */
    public static boolean isAnagram(String s, String t) {
        HashMap<Character, Integer> sMap = new HashMap<>();
        for (char c : s.toCharArray()) {
            if (sMap.get(c) != null) {
                sMap.put(c, sMap.get(c) + 1);
            } else {
                sMap.put(c, 1);
            }
        }
        HashMap<Character, Integer> tMap = new HashMap<>();
        for (char c : t.toCharArray()) {
            if (tMap.get(c) != null) {
                tMap.put(c, tMap.get(c) + 1);
            } else {
                tMap.put(c, 1);
            }
        }

        if (sMap.size() != tMap.size()) return false;
        for (Character character : sMap.keySet()) {
            Integer sInt = sMap.get(character);
            Integer tInt = tMap.get(character);
            if (sInt == null || tInt == null || !sInt.equals(tInt)) return false;
        }
        return true;
    }

    /**
     * 方法错误！！！！！！！！！
     * aa bb 就会识别失败！！！！！
     *
     * @param s
     * @param t
     * @return
     */
    public static boolean isAnagram2(String s, String t) {
        char[] sChars = s.toCharArray();
        char[] tChars = t.toCharArray();

        int result = 0;

        for (char sChar : sChars) {
            result = result ^ sChar;
        }
        for (char tChar : tChars) {
            result = result ^ tChar;
        }
        if (result == 0) return true;
        return false;
    }

    public static boolean isAnagram3(String s, String t) {
        if (s == null || t == null || s.length() != t.length()) return false;
        char[] sChars = s.toCharArray();
        char[] tChars = t.toCharArray();
        Arrays.sort(sChars);
        Arrays.sort(tChars);

        return Arrays.equals(sChars, tChars);
    }

    /*
    统计每个字母的数量，因为知道是26个字母，所以只需要弄个数组长度26，每个位置上存储出现的次数
    但是需要两个数组吗？
    只需要一个，一个数量增加，一个数量减少，最后应当为0
     */
    public static boolean isAnagram4(String s, String t) {
        if (s.length() != t.length()) {
            return false;
        }
        int[] counter = new int[26];
        for (int i = 0; i < s.length(); i++) {
            counter[s.charAt(i) - 'a']++;
            counter[t.charAt(i) - 'a']--;
        }
        for (int count : counter) {
            if (count != 0) {
                return false;
            }
        }
        return true;
    }

    /*
    改进上一个方法，当位置上的数量<0则出现了不同数量
     */
    public static boolean isAnagram41(String s, String t) {
        if (s.length() != t.length()) {
            return false;
        }
        int[] table = new int[26];
        for (int i = 0; i < s.length(); i++) {
            table[s.charAt(i) - 'a']++;
        }
        for (int i = 0; i < t.length(); i++) {
            table[t.charAt(i) - 'a']--;
            if (table[t.charAt(i) - 'a'] < 0) {
                return false;
            }
        }
        return true;
    }

    public static void main(String[] args) {

        String s = "";
        String t = "";
        System.out.println(isAnagram2(s, t));

        String s1 = "aa";
        String t1 = "a";
        System.out.println(isAnagram2(s1, t1));

        String s2 = "aa";
        String t2 = "bb";
        System.out.println(isAnagram2(s2, t2));

    }
}
